    true,nt"url": null,nt"notes": "<p>The EIRF dataset contains information
    about each individual youth who was identified and referred for mental or non-mental
    health related services as part of a grantee's GLS activities (though a screening
    event or by a trained gatekeeper). These individual level records consist of demographic
    information, the setting where the youth was identified, the role of the person
    who made the identification, and what services the youth was referred to after the
    identification. In addition, records contain follow-up information about whether
    the individual received the services for which they were referred.</p>n",nt"license_title":
